-whole and part-to-part comparisons and equivalents','<p><p>The circle graph shows how Tremaine divided his time on the computer last week.<span style=\"font-size: 0.9375rem;\">&nbsp;</span></p><p><img src=\"https://intervene.io/images/Gr%2007%202017_26.PNG\" alt=\"\" width=\"340\" height=\"368\"></p><p>&nbsp;<span style=\"font-size: 0.9375rem;\">Tremaine used the computer a total of 30 hours last week. How many more hours did Tremaine use the computer to play games than to do research?</span></p><br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200627204251+kBRVgl','upliftk12.com+200627204251+xEEJnw',0,1593290571,1593290571,2,2,NULL),(236,40,0,'TEA 2017 - Q27 - 7.11(A) model and solve one-variable, two-step equations and inequalities','<p><p>What is the solution to this equation?</p><p>&nbsp;<span style=\"font-size: 0.9375rem;\">30.16 = 17.56 + 5x</span></p><br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200627221624+ushWNw','upliftk12.com+200627221624+gqnnfR',0,1593296184,1593296184,2,2,NULL),(237,40,0,'TEA 2017 - Q28 - 7.6(I) determine experimental and theoretical probabilities related to simple and compound events using data and sample spaces','<p><p>Rachel is setting up tables for a party. Four of the tables are covered with red tablecloths, and eight of the tables are covered with white tablecloths. Guests will be randomly seated at the tables when they arrive. Each table can seat 8 guests.</p><p>&nbsp;<span style=\"font-size: 0.9375rem;\">What is the probability that the first guest to arrive will be seated at a table with a red tablecloth?</span></p><br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200627222016+5A12kt','upliftk12.com+200627222016+U1iNSO',0,1593296416,1593296416,2,2,NULL),(238,40,0,'TEA 2017 - Q29 - 7.9(D) solve problems involving the lateral and total surface area of a rectangular prism, rectangular pyramid, triangular prism, and triangular pyramid by determining the area of the shape’s net','<p><p>The net of a rectangular prism and its dimensions are shown in the diagram.<span style=\"font-size: 0.9375rem;\">&nbsp;</span></p><p><img src=\"https://intervene.io/images/Gr%2007%202017_29.PNG\" alt=\"\" width=\"400\" height=\"251\"></p><p>&nbsp;<span style=\"font-size: 0.9375rem;\">What is the total surface area of the rectangular prism in square inches?</span></p><br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200627222338+2KuHzs','upliftk12.com+200627222338+9ryIYj',0,1593296618,1593296618,2,2,NULL),(239,40,0,'TEA 2017 - Q30 - 7.13(A) calculate the sales tax for a given purchase and calculate income tax for earned wages','<p>A doctor has an annual income of $152,125. The income tax the doctor has to pay is 6%. What is the amount of income tax in dollars and cents that the doctor has to pay?<br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200627222945+OhEb8u','upliftk12.com+200627222945+hiUbT3',0,1593296985,1593296985,2,2,NULL),(240,40,0,'TEA 2017 - Q31 - 7.6(C) make predictions and determine solutions using experimental data for simple and compound events','<p>A study of a population of 1,200 frogs revealed that 12 out of every 180 frogs in the population have spots on their back. Based on the results of this study, how many frogs in the population do NOT have spots on their back?<br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200627223820+3iyiME','upliftk12.com+200627223820+V7esWc',0,1593297500,1593297500,2,2,NULL),(241,40,0,'TEA 2017 - Q32 - 7.9(B) determine the circumference and area of circles','<p><p>A rotating lawn sprinkler sprays water in a circular area of grass, as shown in the picture. The diameter of the circular area of grass is 16 ft.<span style=\"font-size: 0.9375rem;\">&nbsp;</span></p><p><img src=\"https://intervene.io/images/Gr%2007%202017_32.PNG\" alt=\"\" width=\"189\" height=\"190\"></p><p>&nbsp;<span style=\"font-size: 0.9375rem;\">Which measurement is closest to the area in square feet that this sprinkler sprays with water?</span></p><br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200627224457+MII0hd','upliftk12.com+200627224458+rK0G7T',0,1593297897,1593297897,2,2,NULL),(242,40,0,'TEA 2017 - Q33 - 7.10(C) write a corresponding real-world problem given a one-variable, twostep equation or inequality','<p><p>Which situation can be represented by this inequality?</p><p>&nbsp;<span style=\"font-size: 0.9375rem;\">1.25</span><em style=\"font-size: 0.9375rem;\">x</em><span style=\"font-size: 0.9375rem;\">&nbsp;- 6.50 &gt; 50</span></p><br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200627224954+bKDFAO','upliftk12.com+200627224954+3EX8ia',0,1593298194,1593298194,2,2,NULL),(243,40,0,'TEA 2017 - Q34 - 7.12(A) compare two groups of numeric data using comparative dot plots or box plots by comparing their shapes, centers, and spreads','<p><p>The dot plots show the heights of the players on two basketball teams.<span style=\"font-size: 0.9375rem;\">&nbsp;</span></p><p><img src=\"https://intervene.io/images/Gr%2007%202017_34.PNG\" alt=\"\" width=\"320\" height=\"273\"></p><p>&nbsp;<span style=\"font-size: 0.9375rem;\">Which statement is best supported by these data?</span></p><br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200627225616+pFdzM2','upliftk12.com+200627225616+y5boDg',0,1593298576,1593298576,2,2,NULL),(244,40,0,'TEA 2017 - Q35 - 7.5(C) solve mathematical and real-world problems involving similar shape and scale drawings','<p>The distance between two cities on a map is 3.5 centimeters. The map uses a scale in which 1 centimeter represents 20 kilometers. What is the actual distance between these two cities in kilometers?<br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200627230041+9ss6BS','upliftk12.com+200627230041+wUS4lY',0,1593298841,1593298841,2,2,NULL),(245,40,0,'TEA 2017 - Q36 - 7.3(B) apply and extend previous understandings of operations to solve problems using addition, subtraction, multiplication, and division of rational numbers','<p>Rebecca needs&nbsp;<img src=\"https://intervene.io/images/Gr%2007%202017_36_1.PNG\" alt=\"\" width=\"25\" height=\"32\">&nbsp;yards of fabric to make a quilt. She has one piece of fabric that is yards&nbsp;<img src=\"https://intervene.io/images/Gr%2007%202017_36_2.PNG\" alt=\"\" width=\"22\" height=\"31\">and another piece of fabric that is&nbsp;<img src=\"https://intervene.io/images/Gr%2007%202017_36_3.PNG\" alt=\"\" width=\"19\" height=\"29\">&nbsp;yards. How many more yards of fabric does Rebecca need to make the quilt?<br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200627230512+pWKkZm','upliftk12.com+200627230512+WK22KC',0,1593299112,1593299112,2,2,NULL),(246,40,0,'TEA 2017 - Q37 - 7.6(H) solve problems using qualitative and quantitative predictions and comparisons from simple experiments','<p><p>Leticia has two bouquets of flowers. Each bouquet contains 13 daisies.</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;•Bouquet S contains 30 flowers.<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;•Bouquet T contains 13 flowers.</p><p>Which statement is true?</p><br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200627231007+sezN6C','upliftk12.com+200627231007+9GHZZ6',0,1593299407,1593299407,2,2,NULL),(247,40,0,'TEA 2017 - Q38 - 7.7(A) represent linear relationships using verbal descriptions, tables, graphs, and equations that simplify to the form y = mx + b','<p>A pilot takes a taxi from the airport to a hotel. The taxi driver charges a $2.50 initial charge plus $2.65 per mile. Which equation can be used to find&nbsp;<em>y</em>, the total cost of the trip, if&nbsp;<em>x</em>&nbsp;represents the number of miles of the trip?<br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200627231900+TynzQS','upliftk12.com+200627231900+TwHSau',0,1593299940,1593299940,2,2,NULL),(248,40,0,'TEA 2017 - Q39 - 7.5(A) generalize the critical attributes of similarity, including ratios within and between similar shapes','<p>Mr. Ortiz used similar triangles to make a design. Which statement about the triangles in the design must be true?<br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200627232338+BwEAoq','upliftk12.com+200627232338+UbNG49',0,1593300218,1593300218,2,2,NULL),(249,40,0,'TEA 2017 - Q40 - 7.12(C) compare two populations based on data in random samples from these populations, including informal comparative inferences about differences between the two populations','<p><p>Parker conducted a random survey at the mall to determine the number of songs in each genre that were downloaded by 40 students. The results are shown in the bar graph.<span style=\"font-size: 0.9375rem;\">&nbsp;</span></p><p><img src=\"https://intervene.io/images/Gr%2007%202017_40.PNG\" alt=\"\" width=\"340\" height=\"173\"></p><p>&nbsp;<span style=\"font-size: 0.9375rem;\">Based on the information in the graph, which inference about the general population of students is valid?</span></p><br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200627232944+FPCFqL','upliftk12.com+200627232944+nQYYu5',0,1593300584,1593300584,2,2,NULL),(250,40,0,'TEA Release 2018 - Q1 - 7.4C - Supporting - Math','<p>A recipe says to use 3 cups of flour to make 48 cookies. What is the constant of\r\nproportionality that relates the number of cookies made, y, to the number of cups of flour\r\nused, x ?<br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200628092027+ZRyVQx','upliftk12.com+200628092027+db0kFF',0,1593336027,1593336027,2,2,NULL),(251,40,0,'TEA Release 2018 - Q2 - 7.9B - Readiness - Math','<p>An observatory is shaped like a cylinder standing on one of its bases with a dome on top. The\r\ndiameter of the floor of the observatory is 64 feet, as shown in the diagram.<br></p><p><img src=\"@@PLUGINFILE@@/2.png\" alt=\"\" width=\"244\" height=\"336\" role=\"presentation\" class=\"img-responsive atto_image_button_text-bottom\"><br></p><p>Which measurement is closest to the circumference of the base of the observatory in feet?<br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200628092739+upKoGZ','upliftk12.com+200628092739+xQwpVE',0,1593336459,1593336459,2,2,NULL),(252,40,0,'TEA Release 2018 - Q3 - 7.6I - Readiness - Math','<p>A classroom is arranged with 8 seats in the front row, 10 seats in the middle row, and\r\n12 seats in the back row. The teacher randomly assigns seats to students as they enter the\r\nclassroom.\r\nWhat is the probability that the first student who enters the classroom will be assigned a seat\r\nin the front row?<br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200628094623+15W4oz','upliftk12.com+200628094623+9zGtaZ',0,1593337583,1593337583,2,2,NULL),(253,40,0,'TEA Release 2018 - Q4 - 7.5A - Supporting - Math','<p>Quadrilateral KLMN is similar to quadrilateral WXYZ.<br></p><p><img src=\"@@PLUGINFILE@@/4.png\" alt=\"\" width=\"501\" height=\"335\" role=\"presentation\" class=\"img-responsive atto_image_button_text-bottom\"><br></p><p>Which statement about these quadrilaterals must be true?<br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200628095451+xaNoOg','upliftk12.com+200628095451+KQOmrn',0,1593338091,1593338091,2,2,NULL),(254,40,0,'TEA Release 2018 - Q5 - 7.4A - Readiness - Math','<p>Cheddar cheese costs $4.25 per pound. Which equation best represents y, the total cost of\r\nx pounds of cheddar cheese?<br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200628095941+rmS0QG','upliftk12.com+200628095941+hh7rcI',0,1593338381,1593338381,2,2,NULL),(255,40,0,'TEA Release 2018 - Q6 - 7.6G - Readiness - Math','<p>Ursula surveyed 50 classmates about their favorite ice cream flavors. Each classmate chose\r\none flavor. The results are shown in the circle graph.<br></p><p><img src=\"@@PLUGINFILE@@/6.png\" alt=\"\" width=\"350\" height=\"348\" role=\"presentation\" class=\"img-responsive atto_image_button_text-bottom\"><br></p><p>How many more of Ursula’s classmates chose chocolate than chose vanilla?<br></p><p><br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200628100435+iBF9Bz','upliftk12.com+200628100435+aB2BFx',0,1593338675,1593338675,2,2,NULL),(256,40,0,'TEA Release 2018 - Q7 - 7.11A - Readiness - Math','<p>What is the solution set for -4x - 10 ≤ 2?<br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200628103109+Xbkvws','upliftk12.com+200628103109+mJD4Yu',0,1593340269,1593340269,2,2,NULL),(257,18,0,'TEA 2017 - Q1 - 8.5(F) distinguish between proportional and non-proportional situations using tables, graphs, and equations in the form y = kx or y = mx + b, where b ≠ 0','<p>Which graph shows a non-proportional linear relationship between&nbsp;<em>x</em>&nbsp;and<em>&nbsp;y</em>?<br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200628105506+HFw1OW','upliftk12.com+200628105506+gdN6gc',0,1593341706,1593341706,2,2,NULL),(258,18,0,'TEA 2017 - Q2 - 8.10(C) explain the effect of translations, reflections over the x- or y-axis, and rotations limited to 90°, 180°, 270°, and 360° as applied to twodimensional shapes on a coordinate plane using an algebraic representation','<p><p>The coordinate grid shows a pentagon. The pentagon is translated 1 unit to the left and 10 units down to create a new pentagon.</p><p><img src=\"https://intervene.io/images/Gr%2008%202016_02.PNG\" alt=\"\" width=\"300\" height=\"301\" style=\"font-size: 0.9375rem;\"></p><p><span style=\"font-size: 0.9375rem;\">Which rule describes this transformation?</span></p><br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200628105657+4tdaox','upliftk12.com+200628105657+wDCLvG',0,1593341817,1593341817,2,2,NULL),(259,18,0,'TEA 2017 - Q3 - 8.2(D) order a set of real numbers arising from mathematical and real-world contexts','<p><p>Two numbers are shown on the number line.</p><p><img src=\"https://intervene.io/images/numnumline82017.png\" alt=\"\" width=\"520\" height=\"67\" style=\"font-size: 0.9375rem;\"></p><p><span style=\"font-size: 0.9375rem;\">Which value is NOT located between these two numbers on the number line?</span></p><br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200628105837+YFz5xW','upliftk12.com+200628105837+JIVz1M',0,1593341917,1593341917,2,2,NULL),(260,18,0,'TEA 2017 - Q4 - 8.4(B) graph proportional relationships, interpreting the unit rate as the slope of the line that models the relationship','<p>A water hose discharges water at a rate of 45 gallons per minute. Which graph has a slope&nbsp;that best represents this rate?<br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200628110115+TKn2RW','upliftk12.com+200628110115+VVo6v6',0,1593342075,1593342075,2,2,NULL),(261,18,0,'TEA 2017 - Q5 - 8.3(C) use an algebraic representation to explain the effect of a given positive rational scale factor applied to two-dimensional figures on a coordinate plane with the origin as the center of dilation','<p><p>Triangle MNP is graphed on a coordinate grid with vertices at M (−3, −6), N (0, 3) and&nbsp;P (6, −3). Triangle MNP is dilated by a scale factor of u with the origin as the center of dilation to create triangle M′N′P′.</p><p><span style=\"font-size: 0.9375rem;\">Which ordered pair represents the coordinates of the vertex P′?</span></p><br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200628110413+ZAEsnf','upliftk12.com+200628110413+ztG6br',0,1593342253,1593342253,2,2,NULL);
INSERT INTO `mdl_question` VALUES (262,18,0,'TEA 2017 - Q6 - 8.4(C) use data from a table or graph to determine the rate of change or slope and y-intercept in mathematical and real-world problems','<p><p>The table shows the number of gallons of gasoline in a car’s gas tank after the car has been&nbsp;driven&nbsp;<em>x</em>&nbsp;miles.</p><p>&nbsp;<img src=\"https://intervene.io/images/Gr%2008%202017_06.PNG\" alt=\"\" width=\"200\" height=\"214\" style=\"font-size: 0.9375rem;\"></p><p><span style=\"font-size: 0.9375rem;\">When these data are graphed on a coordinate grid, the points all lie on the same line. What&nbsp;are the slope and</span><em style=\"font-size: 0.9375rem;\">&nbsp;y-</em><span style=\"font-size: 0.9375rem;\">intercept of this line?</span></p><br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200628110549+kWfTxB','upliftk12.com+200628110549+JXDmyK',0,1593342349,1593342349,2,2,NULL),(263,18,0,'TEA 2017 - Q7 - 8.6(A) describe the volume formula V = Bh of a cylinder in terms of its base area and its height','<p><p>A cylinder and its dimensions are shown in the diagram.</p><p>&nbsp;<img src=\"https://intervene.io/images/Gr%2008%202017_07.PNG\" alt=\"\" width=\"100\" height=\"236\" style=\"font-size: 0.9375rem;\"><br><span style=\"font-size: 0.9375rem;\">Which equation can be used to find</span><em style=\"font-size: 0.9375rem;\">&nbsp;V</em><span style=\"font-size: 0.9375rem;\">, the volume of the cylinder in cubic inches?</span></p><br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200628110724+JXgWn6','upliftk12.com+200628110724+uLkROB',0,1593342444,1593342444,2,2,NULL),(264,18,0,'TEA 2017 - Q8 - 8.5(A) represent linear proportional situations with tables, graphs, and equations in the form of y = kx','<p>The approximate volume in milliliters, m, for a volume of&nbsp;<em>f</em>&nbsp;fluid ounces is equal to 29.57 times the value of&nbsp;<em>f</em>.&nbsp; Which table represents this relationship?<br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200628110926+38HmN7','upliftk12.com+200628110927+eaggel',0,1593342566,1593342566,2,2,NULL),(265,18,0,'TEA 2017 - Q9 - 8.7(C) use the Pythagorean theorem and its converse to solve problems','<p><p>The manager of a car dealership wants to attach a rope with flags to the top of a pole and to a stake in the ground, as shown in the diagram.</p><p>&nbsp;<img src=\"https://intervene.io/images/Gr%2008%202017_09.PNG\" alt=\"\" width=\"220\" height=\"200\" style=\"font-size: 0.9375rem;\"><br><span style=\"font-size: 0.9375rem;\">Based on the diagram, what is the distance in feet from the top of the pole to the bottom of the stake?</span></p><br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200628111129+dGMQ82','upliftk12.com+200628111129+ZGunk7',0,1593342689,1593342689,2,2,NULL),(266,40,0,'TEA Release 2018 - Q8 - 7.6A - Supporting - Math','<p>Jack tossed a coin three times. Which tree diagram shows all the possible outcomes of the\r\ncoin landing heads up or tails up?<br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200628111327+KlfHA4','upliftk12.com+200628111327+TEC6H7',0,1593342807,1593342807,2,2,NULL),(267,18,0,'TEA 2017 - Q10 - 8.5(D) use a trend line that approximates the linear relationship between bivariate sets of data to make predictions','<p><p>The scatterplot shows the number of people in each of 8 different households and the average amount of money each household spent on groceries.</p><p>&nbsp;<img src=\"https://intervene.io/images/Gr%2008%202017_10.PNG\" alt=\"\" width=\"220\" height=\"330\" style=\"font-size: 0.9375rem;\"></p><p><span style=\"font-size: 0.9375rem;\">Based on the scatterplot, what is the best prediction of the average amount of money spent&nbsp;on groceries for a household that has 7 people?</span></p><br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200628111404+ear5Hg','upliftk12.com+200628111404+RLokct',0,1593342844,1593342844,2,2,NULL),(268,18,