hip between the number of boxes of cards she sells and her profit.</p><p>&nbsp;<img src=\"https://intervene.io/images/Gr%2008%202017_39.PNG\" alt=\"\" width=\"242\" height=\"228\" style=\"font-size: 0.9375rem;\"></p><p><span style=\"font-size: 0.9375rem;\">Which of these best describes the profit Emily makes from selling these cards?</span></p><br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200628125053+kqca99','upliftk12.com+200628125053+KqUD6v',0,1593348653,1593348653,2,2,NULL),(300,18,0,'TEA 2017 - Q40 - 8.11(A) construct a scatterplot and describe the observed data to address questions of association such as linear, non-linear, and no association between bivariate data','<p><p>The daily attendance at a bowling alley was recorded for 15 days. The scatterplot shows the number of lanes rented each day and the number of people who bowled that day.</p><p>&nbsp;<img src=\"https://intervene.io/images/Gr%2008%202017_40.PNG\" alt=\"\" width=\"403\" height=\"296\" style=\"font-size: 0.9375rem;\"></p><p><span style=\"font-size: 0.9375rem;\">Which statement is best supported by the scatterplot?</span></p><br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200628125257+6E7MHx','upliftk12.com+200628125257+Vz786Y',0,1593348777,1593348777,2,2,NULL),(301,18,0,'TEA 2017 - Q41 - 8.7(A) solve problems involving the volume of cylinders, cones, and spheres','<p><p>A container that holds sugar is shaped like a cylinder. The radius of the container is 3 inches, and the height of the container is 10.5 inches.</p><p><span style=\"font-size: 0.9375rem;\">Which measurement is closest to the volume of the container in cubic inches?</span></p><br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200628125453+0BgvQY','upliftk12.com+200628125453+taPix3',0,1593348893,1593348893,2,2,NULL),(302,18,0,'TEA 2017 - Q42 - 8.9(A) identify and verify the values of x and y that simultaneously satisfy two linear equations in the form y = mx + b from the in