131806+PpNK9P','upliftk12.com+200628131806+0y8AIY',0,1593350286,1593350286,2,2,NULL),(306,46,0,'TEA 2017 - Q4 - A.7(C) determine the effects on the graph of the parent function f(x) = x2 when f(x) is replaced by af(x), f(x) + d, f(x – c), f(bx) for specific values of a, b, c, and d','<p>The graph of&nbsp;<em>f(x)</em><strong>=&nbsp;</strong><em>x<sup>2</sup>&nbsp;</em>was transformed to create the graph of&nbsp;<em>g(x</em>)&nbsp;<strong>=&nbsp;</strong>(<em>x -&nbsp;</em>7.5)<sup>2</sup>. Which of these describes this transformation?<br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200628131942+7U3z7p','upliftk12.com+200628131942+mp8O7h',0,1593350382,1593350382,2,2,NULL),(307,46,0,'TEA 2017 - Q5 - A.2(A) determine the domain and range of a linear function in mathematical problems; determine reasonable domain and range values for real-world situations, both continuous and discrete; and represent domain and range using inequaliti','<p><p>A set of weights includes a 4 lb barbell and 6 pairs of weight plates. Each pair of plates weighs 20 lb. If&nbsp;<em>x&nbsp;</em>pairs of plates are added to the barbell, the total weight of the barbell and plates in pounds can be represented by&nbsp;<em>f (x</em>&nbsp;)&nbsp;<strong>=&nbsp;</strong>20<em>x&nbsp;</em><strong>+&nbsp;</strong>4.</p><p><span style=\"font-size: 0.9375rem;\">What is the range of the function for this situation?</span></p><br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200628132131+ruInzh','upliftk12.com+200628132131+Pz7UgG',0,1593350491,1593350491,2,2,NULL),(308,46,0,'TEA 2017 - Q6- A.11(B) simplify numeric and algebraic expressions using the laws of exponents, including integral and rational exponents','<p>The area of a rectangle is 54<em>x<sup>9</sup>y<sup>8</sup></em>&nbsp;&nbsp;square yards. If the length of the rectangle is 6<em>x<sup>3</sup>y<sup>4</sup>&nbsp;</em>yards, which expression represents the width of the rectangle in yards?<br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200628132305+NRMOke','upliftk12.com+200628132305+rSooVQ',0,1593350585,1593350585,2,2,NULL),(309,46,0,'TEA 2017 - Q7 - A.8(A) solve quadratic equations having real solutions by factoring, taking square roots, completing the square, and applying the quadratic formula','<p>The total number of seats in an auditorium is modeled by&nbsp;<em>f (x) = 2x<sup>2</sup></em><em>- &nbsp;6x</em>, where&nbsp;<em>x</em>&nbsp;represents the number of rows of seats. How many rows are there in the auditorium if it has a total of 416 seats?<br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200628132852+Qspv0N','upliftk12.com+200628132852+shgAbz',0,1593350932,1593350932,2,2,NULL),(310,46,0,'TEA 2017 - Q8 - A.9(D) graph exponential functions that model growth and decay and identify key features, including y-intercept and asymptote, in mathematical and real-world problems','<p><p>The graph of an exponential function is shown on the grid.</p><p>&nbsp;<img src=\"https://intervene.io/images/Gr%20Al%202017_8.PNG\" alt=\"\" width=\"340\" height=\"317\" style=\"font-size: 0.9375rem;\"></p><p><span style=\"font-size: 0.9375rem;\">Which dashed line is an asymptote for the graph?</span></p><br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200628133457+MYoErJ','upliftk12.com+200628133457+XgYAvR',0,1593351297,1593351297,2,2,NULL),(311,46,0,'TEA 2017 - Q9 - A.4(B) compare and contrast association and causation in real-world problems','<p>Which situation best represents causation?<br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'upliftk12.com+200628133853+ZDWQvX','upliftk12.com+200628133853+7rmCoG',0,1593351533,1593351533,2,2,NULL),(312,46,0,'TEA 2017 - Q10 - A.6(C) write quadratic functions when given real solutions and graphs of their related equations','<p><p>The graph of a quadratic function is shown on the grid.</p><p><img src=\"https://intervene.io/images/algnewquad.png\" alt=\"\" width=\"403\" height=\"405\" style=\"f