7 in.3\n\n','296.88 in.3\n\n',NULL,1593589245),(190,8,42,'deferredfeedback',302,1,1.0000000,0.0000000,1.0000000,0,'Frank and Erica are selling ribbons to raise money for the football team. The graph shows the linear relationship between the number of ribbons each of them has left to sell and the number of days that they have been selling ribbons.\n\nOn which day does it appear that Frank and Erica will have the same number of ribbons left to sell?\n\n: Day 48\n\n; Day 18\n\n; Day 33\n\n; Day 15\n\n','Day 18\n\n',NULL,1593589245);
